import React from "react";
import S from "./CreateBreed.module.css";
function CreateBreed() {
  return (
    <div>
      <div className={S.container}>
        <form className="form-top" id="form-top" onSubmit={handleSubmit}>
          <input
            required
            name="name"
            type="text"
            value={input.name}
            placeholder="Name"
            onChange={handleChange}
          />
          <input
            required
            name="weight"
            type="number"
            value={input.weight}
            placeholder="Weight"
            onChange={handleChange}
            min="1"
          />
          <input
            required
            name="height"
            type="number"
            value={input.height}
            placeholder="Height"
            min="1"
          />
          <input
            required
            name="life_span"
            type="number"
            value={input.life_span}
            placeholder="Life span"
            onChange={handleChange}
            min="1"
          />
        </form>
      </div>
    </div>
  );
}

export default CreateBreed;
